import './Main.css';
import Header from './components/header/Header';
import { Routes, Route } from "react-router-dom";
import Blog from './pages/Blog';
import Cenik from './pages/Cenik';
import Kontakt from './pages/Kontakt';
import NaseSluzby from './pages/NaseSluzby';
import Reference from './pages/Reference';
import Realizace from './pages/Realizace';
import Vizualizace from './pages/Vizualizace';
import Home from './pages/Home';
function Main() {
  return (
    <div className="App">
      <Header/>
      <Routes>
        <Route path='/' element={<Home />}/>
        <Route path='/blog' component={Blog} />
        <Route path='/cenik' component={Cenik} />
        <Route path='/kontakt' component={Kontakt} />
        <Route path='/naseSluzby' component={NaseSluzby} />
        <Route path='/reference' component={Reference} />
        <Route path='/realizace' component={Realizace} />
        <Route path='/vizualizace' component={Vizualizace} />
      </Routes>
    </div>
  );
}

export default Main;
